import { Avatar, Box, Card, CardContent, CardHeader, CardMedia, CardActions, Grid, Typography, IconButton, Chip } from "@material-ui/core";
import { red, indigo } from "@material-ui/core/colors"
import NearMeIcon from '@material-ui/icons/NearMe';
import ImageGallery from 'react-image-gallery';
import one from '../images/wallpaper.png';
import { Carousel } from "react-bootstrap";
import { Icon } from "@material-ui/core";

const projectList = [1];
const items =[
    {original:one, originalWidth:'1rem'},
    {original:one, originalWidth:'1rem'}];

function Projects() {
    return (
        <Box overflow='auto' p={3}>
            <Grid container justifyContent='center' flexWrap='wrap'>
                {projectList.map(item =>
                    <Grid item>
                        <Card sx={{ width: 345 }}>
                            <CardHeader
                                avatar={<Avatar sx={{ bgcolor: red[500] }}>API</Avatar>}
                                title={<Typography color='success.dark'>API Weather App</Typography>}
                                subheader={<Typography fontSize='0.8rem'sx={{textDecoration:'underline'}}>APIWeatherApp.feidorian.dev</Typography>}
                                action={
                                <IconButton component='a' href='https://apiweatherapp.feidorian.dev' target='_blank'>
                                    <NearMeIcon sx={{ color: indigo[500], fontSize: '2rem' }} />
                                    </IconButton>
                                }>

                            </CardHeader>
                            <CardMedia >
                                <Carousel >
                                    <Carousel.Item style={{backgroundColor:'red', height:'14rem'}}>
                                        <Box component='img' src={one} />
                                    </Carousel.Item>
                                    <Carousel.Item style={{backgroundColor:'red', height:'14rem'}}>
                                        <Box component='img' src={one} />
                                    </Carousel.Item>
                                </Carousel>
                            </CardMedia>
                            <CardContent>
                                <Typography variant="body2" color="text.secondary" textAlign='center'>
                                    API Weather APP is a functional live weather application built on a backend powered by the Google Places, AWS Lambda, and Open Weather API's.
                                </Typography>
                            </CardContent>
                            <CardActions>
                               <Chip label='React' color='primary' variant='outlined' size='small'/> 
                            </CardActions>
                        </Card>
                    </Grid>
                )}
            </Grid>
        </Box>
    )
};

export default Projects;
